import os
import base64

MY_PERSON_ICON = b''
def set_icon(root):

    path=os.path.join(os.getenv('temp'),'temp.ico')
    print(path)
    with open(path,'wb') as tmp:
        tmp.write(base64.b64decode(MY_PERSON_ICON))
    root.iconbitmap(path)
    os.remove(path)

